graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Combined Application</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Init" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Init</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Initialize</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2", URL="#L6:0-6:23"];
  "Final" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Final</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Final State</td></tr></table>>, pad=0.5, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2", URL="#L7:0-7:25"];
  "StartA" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>StartA</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ProcessA" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessA</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ProcessB" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ProcessB</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "StartB" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>StartB</b></td></tr></table>>, pad=0.5, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "Init" -> "StartA" [style="dashed", labelOverlay="75%", edgeURL="#L9:5-9:15"];
  "StartA" -> "ProcessA" [style="dashed", labelOverlay="75%", edgeURL="#L9:16-9:28"];
  "ProcessA" -> "ProcessB" [style="dashed", labelOverlay="75%", edgeURL="#L9:29-9:41"];
  "ProcessB" -> "StartB" [style="dashed", labelOverlay="75%", edgeURL="#L9:42-9:52"];
  "StartB" -> "Final" [style="dashed", labelOverlay="75%", edgeURL="#L9:53-9:62"];
}
